{"url":"https://api.github.com/repos/panjf2000/ants/issues/comments/515477756","html_url":"https://github.com/panjf2000/ants/pull/40#issuecomment-515477756","issue_url":"https://api.github.com/repos/panjf2000/ants/issues/40","id":515477756,"node_id":"MDEyOklzc3VlQ29tbWVudDUxNTQ3Nzc1Ng==","user":{"login":"Anteoy","id":17495446,"node_id":"MDQ6VXNlcjE3NDk1NDQ2","avatar_url":"https://avatars.githubusercontent.com/u/17495446?v=4","gravatar_id":"","url":"https://api.github.com/users/Anteoy","html_url":"https://github.com/Anteoy","followers_url":"https://api.github.com/users/Anteoy/followers","following_url":"https://api.github.com/users/Anteoy/following{/other_user}","gists_url":"https://api.github.com/users/Anteoy/gists{/gist_id}","starred_url":"https://api.github.com/users/Anteoy/starred{/owner}{/repo}","subscriptions_url":"https://api.github.com/users/Anteoy/subscriptions","organizations_url":"https://api.github.com/users/Anteoy/orgs","repos_url":"https://api.github.com/users/Anteoy/repos","events_url":"https://api.github.com/users/Anteoy/events{/privacy}","received_events_url":"https://api.github.com/users/Anteoy/received_events","type":"User","site_admin":false},"created_at":"2019-07-26T14:32:55Z","updated_at":"2019-07-26T14:32:55Z","author_association":"CONTRIBUTOR","body":"> By the way, you said you faced a performance issue when you were unable to pre-malloc memory of workers slice, so you are proposing this PR. My question is: did you apply this memory optimization logic to your own `ants` and get an enhancement in your go services as expected?

Yes, I have applied it on my online server. which almost have 3 million app users with three server. Just as I say, Locking at high concurrency is like an atomic bomb.Even if I only use rand during the lock. Another things that I did for the performance is that I map the task to 10 pool, That is to say, each go program has about 5 million goroutines using 10 ants pools, each of which has a pool slice of 50 0000, which also improves the performance of slice locks like a sharding map.
